import React from 'react';
import './task7.css'
export class Login extends React.Component{
    constructor(props){
        super(props);
        this.state={count:0}
    }
    change(){
        this.setState({count:1})
    }
    render(){
        return(
            <div className="Button">
                <br></br>
                <br></br>
                <br></br>
                <br></br>
                <button className="Button1" onClick={()=>this.change()}><h1>APPLY</h1></button>
                
                <button className="Button2"><h1>POST</h1></button>
            </div>
        )
    }
}
export default Login;
